// components/Post.js
import React from 'react';
import { Card, CardContent, Avatar, Typography } from '@mui/material';
import './Post.css'; // You can style this component using CSS

const Post = ({ username, caption, imageUrl }) => {
  return (
    <Card className="post">
      {/* User info */}
      <div className="post__header">
        <Avatar
          className="post__avatar"
          alt={username}
          src="/static/images/avatar/1.jpg" // Replace with user's profile picture
        />
        <h3>{username}</h3>
      </div>

      {/* Post image */}
      <img className="post__image" src={imageUrl} alt={caption} />

      {/* Post caption */}
      <CardContent>
        <Typography variant="body2">
          <strong>{username}</strong> {caption}
        </Typography>
      </CardContent>
    </Card>
  );
};

export default Post;
